var APP = angular.module("APP");

APP.config([ "$locationProvider", "$stateProvider", "$urlRouterProvider", function($locationProvider, $stateProvider, $urlRouterProvider) {
    var _initialized = false;
    $urlRouterProvider.when("/{path:.*}", [ "_user", "$state", function(_user, $state) {
        if (!_initialized) {
            _initialized = true;
            _user.get_user_silent();
        }
        return false;
    } ]);
    $stateProvider.state("index", {
        url: "/",
        controller: "indexController",
        templateUrl: "pages/application/index/template.html",
        params: {
            contact: null
        }
    }).state("find", {
        url: "/find/",
        controller: "findController",
        templateUrl: "pages/application/find/template.html"
    }).state("sell", {
        url: "/sell/",
        controller: "sellController",
        templateUrl: "pages/application/sell/template.html"
    }).state("wtf", {
        url: "/wtf/",
        controller: "wtfController",
        templateUrl: "pages/application/wtf/template.html"
    }).state("bugs", {
        url: "/bugs/",
        controller: "bugsController",
        templateUrl: "pages/application/bugs/template.html"
    }).state("profile", {
        url: "/profile/",
        controller: "profileController",
        templateUrl: "pages/application/profile/template.html",
        resolve: {
            authorized: [ "_user", "_notifications", "$state", "$timeout", function(_user, _notifications, $state, $timeout) {
                return _user.get_user_silent().then(function() {
                    return true;
                }).catch(function(err) {
                    _notifications.handle_error(err.data.notifications);
                    return false;
                });
            } ]
        }
    }).state("profile.overview", {
        url: "overview/",
        controller: "profile/overviewController",
        templateUrl: "pages/application/profile/overview/template.html"
    }).state("profile.stats", {
        url: "stats/",
        controller: "profile/statsController",
        templateUrl: "pages/application/profile/stats/template.html"
    }).state("profile.messages", {
        url: "messages/",
        controller: "profile/messagesController",
        templateUrl: "pages/application/profile/messages/template.html"
    }).state("profile.books", {
        url: "books/",
        controller: "profile/booksController",
        templateUrl: "pages/application/profile/books/template.html"
    }).state("profile.settings", {
        url: "settings/",
        controller: "profile/settingsController",
        templateUrl: "pages/application/profile/settings/template.html"
    }).state("profile.wishlist", {
        url: "wishlist/",
        controller: "profile/wishlistController",
        templateUrl: "pages/application/profile/wishlist/template.html"
    });
    $locationProvider.html5Mode(true);
} ]);

var APP = angular.module("APP");

APP.factory("_notifications", [ function() {
    var _id_count = 0;
    var _notifications = [];
    var add_notification = function(message, type, id) {
        if (!id) {
            _id_count++;
            id = "no_id_" + _id_count;
        }
        _notifications.push({
            message: message,
            id: id,
            type: type
        });
    };
    var add_notifications = function(notifications) {
        var l = notifications.length;
        for (var i = 0; i < l; i++) {
            add_notification(notifications[i].message, notifications[i].type, notifications[i].id);
        }
    };
    var remove_notification = function(id) {
        var l = _notifications.length;
        for (var i = 0; i < l; i++) {
            if (_notifications[i].id === id) {
                _notifications.splice(i, 1);
                break;
            }
        }
    };
    return {
        ERROR: function(message) {
            add_notification(message, "ERROR");
        },
        SUCCESS: function(message) {
            add_notification(message, "SUCCESS");
        },
        INFO: function(message) {
            add_notification(message, "INFO");
        },
        remove: function(notification) {
            remove_notification(notification.id);
        },
        handle_success: function(notifications) {
            if (notifications) {
                add_notifications(notifications);
            }
        },
        handle_error: function(notifications) {
            if (!notifications) {
                this.ERROR("Unknown error");
            } else {
                add_notifications(notifications);
            }
        },
        list: _notifications
    };
} ]);

var APP = angular.module("APP");

APP.factory("_user", [ "$q", "$http", "_notifications", function($q, $http, _notifications) {
    var _user = {
        _id: undefined
    };
    return {
        user: _user,
        get_user_silent: function() {
            var _this = this;
            var deferred = $q.defer();
            if (!_user._id) {
                $http({
                    method: "GET",
                    url: "/api/users/user"
                }).then(function(result) {
                    angular.copy(result.data.user, _user);
                    deferred.resolve(result.data.user);
                }).catch(function(err) {
                    deferred.reject(err);
                });
            } else {
                deferred.resolve(_user);
            }
            return deferred.promise;
        },
        local_sign_in: function(email, password, remember_me) {
            var _this = this;
            var deferred = $q.defer();
            $http({
                method: "GET",
                url: "/api/auth/local",
                params: {
                    email: email,
                    password: password,
                    remember_me: remember_me
                }
            }).then(function(result) {
                angular.copy(result.data.user, _user);
                deferred.resolve(result);
            }).catch(function(err) {
                deferred.reject(err);
            });
            return deferred.promise;
        },
        local_sign_up: function(email, first_name, last_name, password, confirm_password) {
            var _this = this;
            var deferred = $q.defer();
            if (!_user._id) {
                _notifications.ERROR("You are already signed in");
                deferred.reject();
            } else {
                $http({
                    method: "POST",
                    url: "/api/auth/local",
                    data: {
                        email: email,
                        first_name: first_name,
                        last_name: last_name,
                        password: password,
                        confirm_password: confirm_password
                    }
                }).then(function(result) {
                    angular.copy(result.data.user, _user);
                    deferred.resolve(result);
                }).catch(function(err) {
                    deferred.reject(err);
                });
            }
            return deferred.promise;
        },
        social_sign_in: function(destination) {
            var _this = this;
            var deferred = $q.defer();
            var width = 1e3;
            var height = 700;
            var left = screen.width / 2 - width / 2;
            var top = screen.height / 2 - height / 2;
            var auth_window = window.open(destination, "_blank", "width=" + width + ", height=" + height + ", left=" + left + ", top=" + top);
            window._auth_callback = function(platform, user) {
                if (user) {
                    _notifications.SUCCESS("Signed you in via " + platform + "!");
                    angular.copy(user, _user);
                    $("#modal-local-sign-in").modal("hide");
                    $("#modal-local-sign-up").modal("hide");
                    deferred.resolve();
                } else {
                    _notifications.ERROR("Failed to sign you in via " + platform);
                    deferred.reject();
                }
                auth_window.close();
            };
            return deferred.promise;
        }
    };
} ]);